import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {faStar as faStarSolid } from '@fortawesome/free-regular-svg-icons'
import { faStar as faStarRegular } from '@fortawesome/free-regular-svg-icons'


export default function regStar({ onStarClicked, isStarred}) {  
    return (
        <button onClick ={onStarClicked}>
            <FontAwesomeIcon icon ={isStarred ? faStarSolid:faStarRegular}></FontAwesomeIcon>
        </button>
        );



}
